<script>
	var socket = io.connect();
	socket.emit('initWeb', 1);
	
	
	socket.on('video', function(msg) {
		
		document.getElementById('video').setAttribute(
			'src', msg
		);
	});
	
	
	
	function foward(){
		socket.emit('foward', 1);
	}
	
	function backward(){
		socket.emit('backward', 1);
	}
	
	function left(){
		socket.emit('left', 1);
	}
	
	function right(){
		socket.emit('right', 1);
	}

</script>
